void addGroupToCategory()
{
    ProjValProjCategoryTable    locProjValProjCategoryTable;
    container                   data;

    locProjValProjCategoryTable = projValProjCategoryTable_NotGroup_DS.getFirst(1);

    if (!locProjValProjCategoryTable)
    {
        data += projValProjCategoryTable_NotGroup.GroupId;
    }
    else
    {
        while (locProjValProjCategoryTable)
        {
            data += locProjValProjCategoryTable.GroupId;
            locProjValProjCategoryTable = projValProjCategoryTable_NotGroup_DS.getNext();
        }
    }

    ProjValGroupServer::addProjCategoryGroupToCategory(data, categoryId);
}

void addProjToCategory()
{
    ProjTable   locProjTable;
    container   data;

    locProjTable = projTable_NotCategory_DS.getFirst(1);

    if (!locProjTable)
    {
        data    += projTable_NotCategory.ProjId;
    }
    else
    {
        while (locProjTable)
        {
            data += locProjTable.ProjId;
            locProjTable = projTable_NotCategory_DS.getNext();
        }
    }

    ProjValElementServer::addProjToCategory(data, categoryId);
}

void buildQuery()
{
    str     groupStr;
    ProjValProjCategorySetUp    setupTbl;

    if (categoryId)
    {
        // Build a filtering condition based on all the groupID associated to the Category in ProjValProjCategorySetup table
        while select GroupId from setupTbl
            group by GroupId
            where setupTbl.CategoryId == categoryId
        {
            if (!groupStr)
            {
                groupStr = strfmt('(%1.%2 == "%3")',qbd.name(), fieldstr(ProjValProjCategorySetUp,GroupId), setupTbl.GroupId);
            }
            else
            {
                groupStr += strfmt(' || (%1.%2 == "%3")',qbd.name(), fieldstr(ProjValProjCategorySetUp,GroupId), setupTbl.GroupId);
            }
        }

        // Also filter by the CategoryID and blank CategoryId to get all the projects for the groups associated with the category
        list_CategoryId.value(strfmt('(%1.%2 == "%3") || (%1.%2 == "")',qbd.name(), fieldstr(ProjValProjCategorySetUp,CategoryId), categoryId));
    }

    if (groupStr)
    {
        list_GroupId.value(groupStr);
    }
    else
    {
        list_GroupId.value(SysQuery::valueEmptyString());
    }
}

